import java.util.ArrayList;
import java.util.List;

class Solution {
    public List<Integer> beautifulIndices(String s, String a, String b, int k) {
        List<Integer> result = new ArrayList<>();
        List<Integer> aIndices = new ArrayList<>();
        List<Integer> bIndices = new ArrayList<>();
        int aLen = a.length(), bLen = b.length();

        for (int i = 0; i <= s.length() - aLen; i++) {
            if (s.substring(i, i + aLen).equals(a)) aIndices.add(i);
        }

        for (int i = 0; i <= s.length() - bLen; i++) {
            if (s.substring(i, i + bLen).equals(b)) bIndices.add(i);
        }

        for (int i : aIndices) {
            for (int j : bIndices) {
                if (Math.abs(j - i) <= k) {
                    result.add(i);
                    break;
                }
            }
        }

        return result;
    }
}
